import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import NavigationBar from './components/NavigationBar';
import Footer from './components/Footer';
import Home from './pages/Home';
import Stargate from './pages/Stargate'; // Make sure to create these pages
import Library from './pages/Library';
import Treasures from './pages/Treasures';
import Mastery from './pages/Mastery';
import Consultations from './pages/Consultations';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <NavigationBar />
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/stargate" component={Stargate} />
          <Route path="/library" component={Library} />
          <Route path="/treasures" component={Treasures} />
          <Route path="/mastery" component={Mastery} />
          <Route path="/consultations" component={Consultations} />
          {/* Add additional routes here */}
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
